import './searchbar.css'

const SearchBar = (props) => {

  const handleChange = (event) => {
    props.onSetSearchWord(() => event.target.value);
  }

  return (
    <div>
      <input type="text" value={props.setSearchWord} onChange={handleChange} placeholder="Search the vocab here" />
    </div>
  )
}

export default SearchBar;
